function App() {
  const date = new Date();
  const showTime = date.getHours()
    + ':' + date.getMinutes()
    + ":" + date.getSeconds();
  const { token, setToken } = useToken();
  const { removeToken } = useToken();
  // <Login setToken={setToken} />
  // const allValues = getAllLocalStorageValues();
  // console.log(allValues);
  if (!token) {
    return <Login setToken={setToken} />
  }

  return (
    <div className="wrapper">
      <h1>Application</h1>
      <h1 align="center">Current Time</h1>
      <h2 align="center"> {showTime}</h2>
      <BrowserRouter>
        <Routes>
          <Route path="/d" element={<Dashboard />} />
          <Route path="/p" element={<Preferences />} />
          <Route path="/a" element={<Aadhar />} />
        </Routes>
      </BrowserRouter>
      <div>
        <button onClick={removeToken}>Log Out</button>
      </div>
    </div>
  );
}

export default App;
